void cap_picc_csr_int_picc_int_enable_clear_t::show() {
    PLOG_MSG(get_hier_path() << "(all) : 0x" << hex << all() << dec << endl);
    if(all() == 0) return;

    PLOG_MSG(hex << string(get_hier_path()) << ".uncorrectable_ecc_enable: 0x" << int_var__uncorrectable_ecc_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".correctable_ecc_enable: 0x" << int_var__correctable_ecc_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".cache_stg_awlen_err_enable: 0x" << int_var__cache_stg_awlen_err_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".cache_hbm_rresp_slverr_enable: 0x" << int_var__cache_hbm_rresp_slverr_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".cache_hbm_rresp_decerr_enable: 0x" << int_var__cache_hbm_rresp_decerr_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".cache_hbm_bresp_slverr_enable: 0x" << int_var__cache_hbm_bresp_slverr_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".cache_hbm_bresp_decerr_enable: 0x" << int_var__cache_hbm_bresp_decerr_enable << dec << endl);
}
#endif // CSR_NO_SHOW_IMPL

