bool cap_picc_csr_int_picc_int_enable_clear_t::get_field_val(const char * field_name, cpp_int & field_val, int level) { 
    bool field_found = false;
    if(level==0) return field_found;
    if(!strcmp(field_name, "all")) { field_val = all(); field_found = 1; }

    if(!field_found && !strcmp(field_name, "uncorrectable_ecc_enable")) { field_val = uncorrectable_ecc_enable(); field_found=1; }
    if(!field_found && !strcmp(field_name, "correctable_ecc_enable")) { field_val = correctable_ecc_enable(); field_found=1; }
    if(!field_found && !strcmp(field_name, "cache_stg_awlen_err_enable")) { field_val = cache_stg_awlen_err_enable(); field_found=1; }
    if(!field_found && !strcmp(field_name, "cache_hbm_rresp_slverr_enable")) { field_val = cache_hbm_rresp_slverr_enable(); field_found=1; }
    if(!field_found && !strcmp(field_name, "cache_hbm_rresp_decerr_enable")) { field_val = cache_hbm_rresp_decerr_enable(); field_found=1; }
    if(!field_found && !strcmp(field_name, "cache_hbm_bresp_slverr_enable")) { field_val = cache_hbm_bresp_slverr_enable(); field_found=1; }
    if(!field_found && !strcmp(field_name, "cache_hbm_bresp_decerr_enable")) { field_val = cache_hbm_bresp_decerr_enable(); field_found=1; }
    return field_found;
}
